import React, { Component } from 'react'

export default class Phones extends Component {
    render() {
        const phoneItems = this.props.phones.map( phone => (
         <div className="col-md-6">
             <div className="thumbnail text-center pt-4">
                 <br/>
                <a href={`#${phone.id}`}  onClick={this.props.handleAddCharacteristics}>
                    <img src={`/phones/${phone.id}.jpg`} alt={phone.name}/>
                    <p className="text-white">{phone.name} </p>

                </a>
                <div>
                <p>{phone.price}</p>

                    <button className="btn-btn-default c">price</button>
                </div>
            </div>
         </div>   )

        )

        return (
            <div className="row">
                {phoneItems}
            </div>
        )
    }
}
